package com.zhixing.work.zhixin.network;import com.zhixing.work.zhixin.bean.AuthenticateBody;import com.zhixing.work.zhixin.network.response.AuthenticateListResult;import com.zhixing.work.zhixin.network.response.StsTokenResult;import com.zhixing.work.zhixin.network.response.SubmitAuthenticateResult;import retrofit2.Call;import retrofit2.http.Body;import retrofit2.http.GET;import retrofit2.http.PUT;/** * */public interface SpaService {    @GET(RequestConstant.GET_OSS)    Call<StsTokenResult> getStsToken();    @GET(RequestConstant.AUTHENTICATES)    Call<AuthenticateListResult> getAuthenticates();    @PUT(RequestConstant.AUTHENTICATES)    Call<SubmitAuthenticateResult> submitAuthenticate(@Body AuthenticateBody body);}